INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 4, 0, 'Ahhhhhhhh! I\'m hit!', 14, 0, 100, 0, 0, 46127, 'NeesaNoxDeath');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 1, 0, 'Now you ain\'t so tall no more!', 14, 0, 100, 0, 0, 46130, 'NeesaNoxSpell01');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 50, 0, 'Ooooh! Is there killin\' ta be done? Lemme at\'em!', 14, 0, 100, 0, 0, 46128, 'NeesaNoxIntro');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 3, 0, 'Tick tick tick... BOOM!', 14, 0, 100, 0, 0, 46129, 'NeesaNoxSlay');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 5, 0, 'Time is money, friend! And it looks like you\'s outta both!', 14, 0, 100, 0, 0, 46132, 'NeesaNoxSpell03');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (80808, 2, 0, 'You\'d better step back. I\'m calling in the Bombsquad!', 14, 0, 100, 0, 0, 46131, 'NeesaNoxSpell02');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (86231, 60, 0, 'Hah!', 14, 0, 100, 0, 0, 45800, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (86231, 61, 0, 'This... is... far, from over...', 14, 0, 100, 0, 0, 45799, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (86231, 62, 0, 'You will burn!', 14, 0, 100, 0, 0, 45801, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 7, 0, 'A death worthy of a warrior!', 14, 0, 100, 0, 0, 46065, 'NokgarSpell04');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 4, 0, 'Let them have it!', 14, 0, 100, 0, 0, 46062, 'NokgarSpell01');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 1, 0, 'My blade thirsts for more.', 14, 0, 100, 0, 0, 46061, 'NokgarSlay0');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 1, 1, 'Revel in the slaughter!', 14, 0, 100, 0, 0, 46060, 'NokgarSlay1');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 0, 0, 'Start the funeral pyres!', 14, 0, 100, 0, 0, 46057, 'NokgarAggro');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 6, 0, 'Terror overwhelms you, death is near.', 14, 0, 100, 0, 0, 46064, 'NokgarSpell03');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 5, 0, 'That\'s it? You barely drew blood!', 14, 0, 100, 0, 0, 46063, 'NokgarSpell02');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 3, 0, 'Warsong arrows sing from the sky! They\'ll be the last thing you hear as I crush your skull.', 14, 0, 100, 0, 0, 46059, 'NokgarIntro');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (81305, 2, 0, 'You will burn with me.', 14, 0, 100, 0, 0, 46058, 'NokgarDeath');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 20, 0, 'Aye aye, sir!', 14, 0, 100, 0, 0, 44058, 'Zoggosh08');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 10, 0, 'But sir, this is the last of the gronn that we have! Blackhand will have our hides if we show up empty handed!', 14, 0, 100, 0, 0, 44048, 'Zoggosh02');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 16, 0, 'Captain, they\'re almost here! What do we do now?!', 14, 0, 100, 0, 0, 44054, 'Zoggosh06');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 18, 0, 'Good idea, sir!', 14, 0, 100, 0, 0, 44056, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 13, 0, 'Igniting the cannons, sir!', 14, 0, 100, 0, 0, 44051, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 60, 0, 'Koramar, no! I will avenge you!', 14, 0, 100, 0, 0, 44060, 'Zoggosh09');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 19, 0, 'Oh...', 14, 0, 100, 0, 0, 44057, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 15, 0, 'Sir, half of our army has been taken out! Don\'t you think we should--', 14, 0, 100, 0, 0, 44053, 'Zoggosh05');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 14, 0, 'Sir, he\'s out of ammunition! I\'m reloading, I\'m reloading!', 14, 0, 100, 0, 0, 44052, 'Zoggosh04');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 8, 0, 'Sir, they\'ve breached the gates! Nok\'gar... He\'s dead!! We should pick up anchor and set sail for Talador right now!', 14, 0, 100, 0, 0, 44027, 'Zoggosh01');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 12, 0, 'Sir... they\'re messing with the iron stars!', 14, 0, 100, 0, 0, 44050, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 17, 0, 'Uhhh... Are you sure you want to let that thing out of its cage? I don\'t think we have fed it since we found it.', 14, 0, 100, 0, 0, 44055, 'Zoggosh07');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 21, 0, 'Yes, captain!', 14, 0, 100, 0, 0, 44059, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83616, 11, 0, 'Yessir!', 14, 0, 100, 0, 0, 44049, 'Zoggosh03');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 28, 0, 'Argghhhh! Forget it! They\'ll never make it past the tracks. Makogg, Ahri\'ok - front and center! There\'s some new meat for you to tenderize.', 14, 0, 100, 0, 0, 43905, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 94, 1, 'Bow before the might of the Iron Horde!', 14, 0, 100, 0, 0, 43914, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 23, 0, 'Calm yourself, Zoggosh. We will do no such thing. If these weaklings are so eager to die, then we should oblige.', 14, 0, 100, 0, 0, 43899, 'Koramar23');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 0, 0, 'FIRE... FIRE! AIM, THEN FIRE!', 14, 0, 100, 0, 0, 0, 'Koramar0');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 26, 0, 'FIRE... FIRE! AIM, THEN FIRE!', 14, 0, 100, 0, 0, 46903, 'Koramar26');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 25, 0, 'Hah. Would you look at that. Maybe I... underestimated them. Zoggosh! Prepare Skulloc! Let them have a taste of what he has to offer.', 14, 0, 100, 0, 0, 43901, 'Koramar25');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 50, 0, 'How dare you march into MY DOCKS and so brazenly set foot on MY SHIP. Nothing will stop the Iron Horde, least of all you. Enjoy your death, weaklings. Zoggosh, man the machine turret!', 14, 0, 100, 0, 0, 46911, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 33, 0, 'I didn\'t mean the cat.', 14, 0, 100, 0, 0, 43910, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 31, 0, 'I\'m not playing these games anymore. Bring in the saberon and we\'ll be done with it.', 14, 0, 100, 0, 0, 43908, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 95, 0, 'Inconcivable...', 14, 0, 100, 0, 0, 43989, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 32, 0, 'Put a muzzle on it.', 14, 0, 100, 0, 0, 43909, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 94, 0, 'So WEAK!', 14, 0, 100, 0, 0, 43913, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 29, 0, 'That was an insignificant loss. Let them exhaust themselves, preying against our weak -- against those who are unworthy of serving in Blackhand\'s army! Blood and honor, Zoggosh. That is all that orcs understand.', 14, 0, 100, 0, 0, 43906, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 27, 0, 'What is wrong with you?! Keep firing you oaf!', 14, 0, 100, 0, 0, 46904, 'Koramar27');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 24, 0, 'Zoggosh, do not question my authority. This isn\'t just ANY gronn. This is Skulloc, Son of Gruul. The blood of a champion courses through his veins. I\'m not concerned with these... paltry whelps.', 14, 0, 100, 0, 0, 43900, 'Koramar24');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (83613, 51, 0, 'Zoggosh, ready your axe. This ends now!', 14, 0, 100, 0, 0, 46912, '');
